import React from 'react';
import './card.scss';

const Card=(props)=>
(
    <div className='cardstyleq'>
        <div className='cardq'>
        <img className='card-imageq' alt='ccard' src={`images/${props.ccard.id}.png` }/>

        <h2>
         AUTHOR: {props.ccard.authors}
         </h2>
         <b>
           PAGES: {props.ccard.pageCount}  
           </b>
           <br></br>
          <b>
           CATEGORY: {props.ccard.categories}
           </b>
            
        </div>
   
    TITLE: {props.ccard.title}
    </div>
)
export default Card;
